import { useEffect, useState } from 'react';
import { Link} from 'react-router-dom';

import './suggest.css'


function DeezeflowPlaylists({onPlaylistSelection = () => {} }) {

	const [ DeezePlaylistSelection, setDeezePlaylistSelection ] = useState([]);


	useEffect(
		() => {;
			fetch("http://localhost:3001/user/4633045002/playlists")
			.then((response) => response.json())
			.then((data) => setMoodPlaylistSelection(data.data));
		},
		[ ]
		);


	return (
		<div className="suggest">

	  <h2>Nos Playlists</h2>
		<div className="suggestOther">
			<div className="suggestOtherScroll">
			{DeezePlaylistSelection.slice(0,5).map((playlist) => (
				<Link to = {`/my-playlist/deezeflow/${playlist.id}`}>
<div className="playlistMood" onClick={()=>{onPlaylistSelection(playlist.id)}}>
				<p>{playlist.title}</p>
				<img src={playlist.picture_medium} alt="cover" />
			</div>
        </Link>
			))}
		</div>
		</div>			
		</div>
	);
}

export default DeezeflowPlaylists;
